import React, { useState } from 'react';
import axios from 'axios';

function FoodFest() {
    const [file, setFile] = useState(null);

    const handleFileChange = (e) => {
        setFile(e.target.files[0]);
    };

    const handleUpload = async () => {
        const formData = new FormData();
        formData.append('file', file);

        try {
            const response = await axios.post('http://localhost:5000/api/upload', formData, {
                headers: {
                    'Content-Type': 'multipart/form-data',
                },
            });
            console.log('File uploaded successfully', response.data);
        } catch (error) {
            console.error('Error uploading file', error);
        }
    };

    return (
        <div>
            <section className='header'>
                <img className='banner' src='images/upcoming-events (3).png' alt='food-fest-banner' />
                <img src="images/upcoming-events (2).png" alt="Overlay" className="overlay-image" data-aos="fade-up" />
            </section>
            <section className='search' data-aos="fade-up">
                <div className='container mt-5'>
                    <div className='col-md-12 text-center'>
                        <h2 className='font-weight-bold display-5'>Discover more events</h2>
                        <p className='text-muted'>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
                        <form className="d-flex" role="search">
                            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                            <button className="btn btn-outline-primary" type="submit">Search</button>
                        </form>
                    </div>
                </div>
            </section>
            <section className='event-list'>
                <div className='container mt-5 mb-5'>
                    <div className="row" data-aos="fade-up">
                        <div className="col-md-3">
                            <div className="card text-center foodfest">
                                <div className="card-body">
                                    <img className='card-img-top' src='images/poster-1.png' alt='' />
                                    <h5 className="card-title text-center mt-2 fs-4">Street Food Festival</h5>
                                    <p className="card-text">Some text for item 1</p>
                                    <div className='btn btn-primary text-center'>View Details</div>
                                </div>
                            </div>
                        </div>
                        <div className="col-md-3">
                            <div className="card text-center foodfest">
                                <div className="card-body">
                                    <img className='card-img-top' src='images/poster-2.png' alt='' />
                                    <h5 className="card-title text-center mt-2 fs-4">Night Market</h5>
                                    <p className="card-text">Some text for item 2</p>
                                    <div className='btn btn-primary text-center'>View Details</div>
                                </div>
                            </div>
                        </div>
                        <div className="col-md-3">
                            <div className="card text-center foodfest">
                                <div className="card-body">
                                    <img className='card-img-top' src='images/poster-2.png' alt='' />
                                    <h5 className="card-title text-center mt-2 fs-4">Night Market</h5>
                                    <p className="card-text">Some text for item 2</p>
                                    <div className='btn btn-primary text-center'>View Details</div>
                                </div>
                            </div>
                        </div>
                        <div className="col-md-3">
                            <div className="card text-center foodfest">
                                <div className="card-body">
                                    <img className='card-img-top' src='images/poster-3.png' alt='' />
                                    <h5 className="card-title text-center mt-2 fs-4">Pop-up Market</h5>
                                    <p className="card-text">Some text for item 3</p>
                                    <div className='btn btn-primary text-center'>View Details</div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>

            {/* Add file upload section */}
            <section className='upload-section'>
                <div className='container mt-5'>
                    <h2 className='text-center'>Upload Image</h2>
                    <input type="file" onChange={handleFileChange} />
                    <button className='btn btn-primary' onClick={handleUpload}>Upload</button>
                </div>
            </section>
        </div>
    );
}

export default FoodFest;
